import Document,{Head, Main, NextScript} from 'next/document'

export default class MyDocument extends Document {
    render(){
        return (
            <html>
                <Head>
                    <style>{`body{background:#069}, a{text-decoration:none} `}</style>
                    <body>
                        <Main/>
                        <NextScript/>
                    </body>
                </Head>
            </html>
        )
    }
}
